import React from 'react';
import {  Link } from "react-router-dom";
const navbar= () =>{
  return (
  <div>
      <ul className='navbar'>
    <li>
      <Link className='nav' to="/">Home </Link>
      <Link to="/list"> List </Link>
      <input className='input'></input>
            <input className='input'></input>
            <button className='input'>Login</button>
    </li>
    </ul>
  </div>
  );
}
export default navbar;
